import React, { useEffect } from "react";

import NavBar from "../components/NavBar/NavBar.js";
import Timeline from "../components/Timeline/Timeline.js";
import SideBar from "../components/SideBar/SideBar.js";

/* images */
import { HOME_BIG, EXPLORE_BIG, MORE_OPTIONS_BIG } from "../constants/images.js";

let logoHome = await import(HOME_BIG);

export default function Dashboard(){

    useEffect( () => {
        document.title = "Dashboard - Birdy";
    }, []);

    const menuIcons = [
        {id:"dash-home", src:HOME_BIG, alt:"home menu", msg:"Home"},
        {id:"dash-explore", src:EXPLORE_BIG, alt:"explore menu", msg:"Explore"},
        {id:"dash-more", src:MORE_OPTIONS_BIG, alt:"more option menu", msg:"More"}
    ];

    return(
        <div className="dahsboard row max-height">
            <NavBar menuIcons={menuIcons}/>
            <Timeline />
            <SideBar />
        </div>
    )
};
